import React from "react";
import BlueContainer from "../UI/BlueContainer";
import NavItem from "./NavItem";

const NavBar = async () => {
  const navItems = await fetch("../../../data/navBar.json");
  console.log(await navItems.json);
  return (
    <BlueContainer>
      <div>
        <div>Booking Website</div>
        <div>
          <button>Register</button>
          <button>Login</button>
        </div>
      </div>
      <NavItem />
    </BlueContainer>
  );
};

export default NavBar;
